import React from 'react';

function PicItem(props) {
  return (
    <>
      <li className='pics__item'>
        <div className='pics__item__link'>
          <figure className='pics__item__pic-wrap'>
            <img
              className='pics__item__img'
              alt='Travel Image'
              src={props.src}
            />
          </figure>
          <div className='pics__item__info'>
            <h5 className='pics__item__text'>{props.text}</h5>
          </div>
        </div>
        
      </li>
    </>
  );
}

export default PicItem;
